  data: "<testset xmlns=\"http://cpee.org/ns/properties/2.0\">\n  <executionhandler>ruby</executionhandler>\n  <dataelements>\n    <places>[[0,0],[1,0],[0,1],[1,1],[0,2],[1,2],[0,3],[1,3],[0,4],[1,4],[0,5],[1,5]]</places>\n  </dataelements>\n  <endpoints>\n    <overview>http-put://ryloth.wst.univie.ac.at:9329/move/overview</overview>\n    <move_tool>http-put://ryloth.wst.univie.ac.at:9329/move/position/point</move_tool>\n    <move_camera>http-put://ryloth.wst.univie.ac.at:9329/move/position/view</move_camera>\n    <get_items_base>http-get://ryloth.wst.univie.ac.at:9329/view/items</get_items_base>\n    <get_items_neural>http-get://ryloth.wst.univie.ac.at:9330/view/items</get_items_neural>\n    <get_offset_base>http-get://ryloth.wst.univie.ac.at:9329/view/details</get_offset_base>\n    <get_offset_neural>http-get://ryloth.wst.univie.ac.at:9330/view/details</get_offset_neural>\n    <grip_and_place>http-put://ryloth.wst.univie.ac.at:9329/move/grip_and_place</grip_and_place>\n    <subprocess>https://cpee.org/flow/start/url/</subprocess>\n  </endpoints>\n  <description>\n    <description xmlns=\"http://cpee.org/ns/description/1.0\">\n      <loop mode=\"pre_test\" condition=\"data.places.length &gt; 0\">\n        <_probability>\n          <_probability_min/>\n          <_probability_max/>\n          <_probability_avg/>\n        </_probability>\n        <call id=\"a1\" endpoint=\"overview\">\n          <parameters>\n            <label>Move to overview position</label>\n            <arguments/>\n            <stream>\n              <sensors/>\n              <aggregators/>\n              <costs/>\n            </stream>\n          </parameters>\n          <annotations>\n            <_timing>\n              <_timing_wait/>\n              <_timing_threshold/>\n              <_timing_min/>\n              <_timing_max/>\n              <_timing_avg/>\n            </_timing>\n            <_notes>\n              <_notes_general/>\n            </_notes>\n          </annotations>\n          <documentation/>\n        </call>\n        <call id=\"a3\" endpoint=\"get_items_base\">\n          <parameters>\n            <label>Get item positions</label>\n            <arguments/>\n            <stream>\n              <sensors/>\n              <aggregators/>\n              <costs/>\n            </stream>\n          </parameters>\n          <code>\n            <prepare/>\n            <finalize output=\"result\">data.items = result</finalize>\n            <update output=\"result\"/>\n            <rescue output=\"result\"/>\n          </code>\n          <annotations>\n            <_timing>\n              <_timing_wait/>\n              <_timing_threshold/>\n              <_timing_min/>\n              <_timing_max/>\n              <_timing_avg/>\n            </_timing>\n            <_notes>\n              <_notes_general/>\n            </_notes>\n          </annotations>\n          <documentation/>\n        </call>\n        <choose mode=\"exclusive\">\n          <alternative condition=\"data.items.length &gt; 0\">\n            <call id=\"a5\" endpoint=\"move_camera\">\n              <parameters>\n                <label>Inspect first item</label>\n                <arguments>\n                  <x>!data.items.first['x']</x>\n                  <y>!data.items.first['y']</y>\n                </arguments>\n                <stream>\n                  <sensors/>\n                  <aggregators/>\n                  <costs/>\n                </stream>\n              </parameters>\n              <annotations>\n                <_timing>\n                  <_timing_wait/>\n                  <_timing_threshold/>\n                  <_timing_min/>\n                  <_timing_max/>\n                  <_timing_avg/>\n                </_timing>\n                <_notes>\n                  <_notes_general/>\n                </_notes>\n              </annotations>\n              <documentation/>\n            </call>\n            <call id=\"a2\" endpoint=\"subprocess\">\n              <parameters>\n                <label>Adjust</label>\n                <method>:post</method>\n                <arguments>\n                  <behavior>wait_running</behavior>\n                  <url>https://cpee.org/flow/templates/UR-VUE%202020%20Manual%20Adjust.xml</url>\n                  <init/>\n                  <endpoints/>\n                  <stream/>\n                </arguments>\n                <stream>\n                  <sensors/>\n                  <aggregators/>\n                  <costs/>\n                </stream>\n              </parameters>\n              <code>\n                <prepare/>\n                <finalize output=\"result\">data.place = data.places.shift\ndata.item = result['item']\ndata.item['x'] = data.items.first['x'] + data.item['adjust_x']\ndata.item['y'] = data.items.first['y'] + data.item['adjust_y']</finalize>\n                <update output=\"result\"/>\n                <rescue output=\"result\"/>\n              </code>\n              <annotations>\n                <_timing>\n                  <_timing_wait/>\n                  <_timing_threshold/>\n                  <_timing_min/>\n                  <_timing_max/>\n                  <_timing_avg/>\n                </_timing>\n                <_notes>\n                  <_notes_general/>\n                </_notes>\n              </annotations>\n              <documentation/>\n            </call>\n            <call id=\"a8\" endpoint=\"grip_and_place\">\n              <parameters>\n                <label>Grip and Place</label>\n                <arguments>\n                  <x>!data.item['x']</x>\n                  <y>!data.item['y']</y>\n                  <place_x>!data.place[0]</place_x>\n                  <place_y>!data.place[1]</place_y>\n                </arguments>\n                <stream>\n                  <sensors/>\n                  <aggregators/>\n                  <costs/>\n                </stream>\n              </parameters>\n              <annotations>\n                <_timing>\n                  <_timing_wait/>\n                  <_timing_threshold/>\n                  <_timing_min/>\n                  <_timing_max/>\n                  <_timing_avg/>\n                </_timing>\n                <_notes>\n                  <_notes_general/>\n                </_notes>\n              </annotations>\n              <documentation/>\n            </call>\n            <_probability>\n              <_probability_min/>\n              <_probability_max/>\n              <_probability_avg/>\n            </_probability>\n          </alternative>\n          <otherwise>\n            <terminate/>\n          </otherwise>\n        </choose>\n      </loop>\n    </description>\n  </description>\n  <transformation>\n    <description type=\"copy\"/>\n    <dataelements type=\"none\"/>\n    <endpoints type=\"none\"/>\n  </transformation>\n  <attributes>\n    <info>UR-VUE 2020 Solution Baseline</info>\n    <modeltype>CPEE</modeltype>\n    <theme>preset</theme>\n    <resource>ur51</resource>\n    <creator>Christine Ashcreek</creator>\n    <author>Christine Ashcreek</author>\n    <design_stage>development</design_stage>\n    <design_dir>Templates.dir</design_dir>\n  </attributes>\n</testset>\n"
